with open('classified_data.json', 'r',encoding='utf-8') as r:
    check_data = json.load(r)
    new_key_num = 0
    classified_case_num = 0
    caseid_num_allowing_dupid = 0
    caseid_num_not_allowing_dupid = 0
    caseid_names = []
    show_once = True
    for name in check_data.keys():
        new_key_num += 1
        category = check_data[name]
        category_test_names = []
        for test_name in category.keys():
            if test_name not in category_test_names:
                caseid_num_allowing_dupid += 1
                category_test_names.append(test_name)
            else:
                print("impossible")
            if test_name not in [j for (i, j) in caseid_names]:
                caseid_num_not_allowing_dupid += 1
                caseid_names.append((name, test_name))
            else:
                if show_once:
                    tup = caseid_names[[j for (i, j) in caseid_names].index(test_name)]
                    print(0, check_data[tup[0]][tup[1]])
                    print(1, category[test_name])
                    show_once = False
                caseid_names.append((name, test_name))
            classified_case_num += len(category[test_name])
    print("classified_case_num = " + str(classified_case_num))
    print("caseid_num_allowing_dupid = " + str(caseid_num_allowing_dupid))
    print("caseid_num_not_allowing_dupid = " + str(caseid_num_not_allowing_dupid))
    name_length = len(caseid_names)
    for i in range(math.ceil(name_length/10)):
        tmp_list = [caseid_names[i*10+j] for j in range(10) if i*10+j<name_length]
        print(tmp_list)

